import React from "react";
import { useState } from 'react';
import {qnBuffer, choiceBuffer} from "./Home";
import Axios from 'axios';
import { useNavigate } from "react-router-dom";

function PostForm() {
  const url = "http//localhost:3500/questions/response/Create"
  const [data, setData] = useState({
    name: "",
    colour: {
      Blue: false,
      Red: false,
      Green: false,
      Yellow: false,
      Purple: false,
      Pink: false
    },
    prog_lang: "",
    languages: {
      English: false,
      Chinese: false,
      Malay: false,
      Tamil: false,
      Hindi: false
    }
  })

  function handleChange(e) {
    const newData = { ...data } // copy curr data
    newData[e.target.id] = e.target.value
    setData(newData)
  }

  function handleCheckbox(e) {
    const newData = { ...data } // copy curr data
    const updatedField = newData[e.target.id]
    updatedField[e.target.value] = e.target.checked
    newData[e.target.id] = updatedField
    setData(newData)
  }

  const navigate = useNavigate()
  function handleSubmit(e) {
    e.preventDefault();
    // Axios.post(url, {
    //   name: data.name,
    //   colour: data.colour
    // })
    // .then(res => {console.log(res.data)})
    // .then(navigate("/Summary"))
    console.log("submitted: ", data)
    //navigate("/Summary")
  }

  function generateDropdown(arr =[]) {
    return (
      arr.map(opt => <option>{opt}</option>)
    )
  }

  return (
    <div>
      <form onSubmit={e => handleSubmit(e)}>
        <div>
          <label>{qnBuffer[0]}</label>
          <p><input type="text" required id="name" value={data.name} onChange={handleChange} /></p>
        </div>
        <div>
          <label>{qnBuffer[1]}</label>
          <p><input type="checkbox" id="colour" value="Blue" onChange={handleCheckbox} checked={data.colour.Blue}/> Blue</p>
          <p><input type="checkbox" id="colour" value="Red" onChange={handleCheckbox} checked={data.colour.Red}/> Red</p>
          <p><input type="checkbox" id="colour" value="Green" onChange={handleCheckbox} checked={data.colour.Green}/> Green</p>
          <p><input type="checkbox" id="colour" value="Yellow" onChange={handleCheckbox} checked={data.colour.Yellow}/> Yellow</p>
          <p><input type="checkbox" id="colour" value="Purple" onChange={handleCheckbox} checked={data.colour.Purple}/> Purple</p>
          <p><input type="checkbox" id="colour" value="Pink" onChange={handleCheckbox} checked={data.colour.Pink}/> Pink</p>
        </div>
        <div>
          <label>{qnBuffer[2]}</label>
          <p><input type="radio" name="prog_lang" value="Python" onChange={handleChange} checked={data.prog_lang.Python}/> Python</p>
          <p><input type="radio" name="prog_lang" value="Java" onChange={handleChange} checked={data.prog_lang.Java}/> Java</p>
        </div>
        <div>
          <label>{qnBuffer[3]}</label>
          <p><input type="checkbox" id="languages" value="English" onChange={handleCheckbox} checked={data.languages.English}/> Blue</p>
          <p><input type="checkbox" id="languages" value="Chinese" onChange={handleCheckbox} checked={data.languages.Chinese}/> Red</p>
          <p><input type="checkbox" id="languages" value="Malay" onChange={handleCheckbox} checked={data.languages.Malay}/> Green</p>
          <p><input type="checkbox" id="languages" value="Tamil" onChange={handleCheckbox} checked={data.languages.Text}/> Yellow</p>
          <p><input type="checkbox" id="languages" value="Hindi" onChange={handleCheckbox} checked={data.colour.Purple}/> Purple</p>
        </div>
        <button type="submit">submit</button>
      </form>
    </div>
  )
}

export default PostForm
